import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { FiPlus, FiCalendar } from 'react-icons/fi';
import { Button } from '../../styles/GlobalStyles';
import { 
  PageContainer, 
  PageHeader, 
  PageTitle, 
  HeaderActions
} from '../../components/Common/CommonStyles';
import styled from 'styled-components';
import { theme } from '../../styles/theme';

const TabsContainer = styled.div`
  display: flex;
  gap: ${theme.spacing.md};
  border-bottom: 1px solid ${theme.colors.border};
  margin-bottom: ${theme.spacing.lg};
`;

const Tab = styled.button<{ active: boolean }>`
  padding: ${theme.spacing.md} ${theme.spacing.lg};
  background: transparent;
  border: none;
  border-bottom: 2px solid ${({ active }) => active ? theme.colors.primary : 'transparent'};
  color: ${({ active }) => active ? theme.colors.primary : theme.colors.textSecondary};
  font-weight: ${({ active }) => active ? theme.typography.fontWeight.semibold : theme.typography.fontWeight.medium};
  cursor: pointer;
  transition: all 0.2s;

  &:hover {
    color: ${theme.colors.primary};
  }
`;

const ContentContainer = styled.div`
  background: ${theme.colors.surface};
  border-radius: ${theme.borderRadius.lg};
  padding: ${theme.spacing.xl};
  min-height: 400px;
`;

const DateSelector = styled.div`
  display: flex;
  align-items: center;
  gap: ${theme.spacing.md};
  margin-bottom: ${theme.spacing.lg};
`;

const DateInput = styled.input`
  padding: ${theme.spacing.sm} ${theme.spacing.md};
  border: 1px solid ${theme.colors.border};
  border-radius: ${theme.borderRadius.md};
  background: ${theme.colors.card};
  color: ${theme.colors.textPrimary};
  font-size: ${theme.typography.fontSize.sm};

  &:focus {
    outline: none;
    border-color: ${theme.colors.primary};
  }
`;

const TripCard = styled.div`
  background: ${theme.colors.card};
  border: 1px solid ${theme.colors.border};
  border-radius: ${theme.borderRadius.lg};
  padding: ${theme.spacing.lg};
  margin-bottom: ${theme.spacing.md};
  transition: all 0.2s;

  &:hover {
    background: ${theme.colors.cardHover};
    border-color: ${theme.colors.borderLight};
  }
`;

const TripHeader = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: start;
  margin-bottom: ${theme.spacing.md};
`;

const TripInfo = styled.div`
  flex: 1;
`;

const TripTitle = styled.h4`
  font-size: ${theme.typography.fontSize.lg};
  font-weight: ${theme.typography.fontWeight.semibold};
  color: ${theme.colors.textPrimary};
  margin: 0 0 ${theme.spacing.xs} 0;
`;

const TripDetails = styled.div`
  display: flex;
  gap: ${theme.spacing.lg};
  margin-top: ${theme.spacing.sm};
`;

const DetailItem = styled.div<{ label: string }>`
  font-size: ${theme.typography.fontSize.sm};
  color: ${theme.colors.textSecondary};

  strong {
    color: ${theme.colors.textPrimary};
    margin-right: ${theme.spacing.xs};
  }
`;

const StatusBadge = styled.span<{ status: string }>`
  display: inline-flex;
  align-items: center;
  padding: ${theme.spacing.xs} ${theme.spacing.sm};
  border-radius: ${theme.borderRadius.md};
  font-size: ${theme.typography.fontSize.xs};
  font-weight: ${theme.typography.fontWeight.medium};
  background: ${({ status }) => 
    status === 'in-progress' ? theme.colors.success :
    status === 'completed' ? theme.colors.info :
    theme.colors.surface};
  color: white;
`;

interface Trip {
  id: string;
  tripNumber: string;
  routeName: string;
  scheduledStartTime: string;
  scheduledEndTime: string;
  status: 'planned' | 'in-progress' | 'completed';
  assignedDriver?: string;
  assignedVehicle?: string;
}

const DutiesList: React.FC = () => {
  const navigate = useNavigate();
  const [activeTab, setActiveTab] = useState<'trips' | 'assignment'>('trips');
  const [selectedDate, setSelectedDate] = useState(() => {
    const today = new Date();
    return today.toISOString().split('T')[0];
  });
  const [trips, setTrips] = useState<Trip[]>([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    loadTrips();
  }, [selectedDate]);

  const loadTrips = async () => {
    try {
      setLoading(true);
      // TODO: Replace with actual API call
      // const response = await apiService.getTrips({ date: selectedDate });

      // Sample data for now
      const sampleTrips: Trip[] = [
        {
          id: '1',
          tripNumber: 'T-001',
          routeName: 'Route A - Downtown Loop',
          scheduledStartTime: '06:00',
          scheduledEndTime: '07:00',
          status: 'in-progress',
          assignedDriver: 'John Doe',
          assignedVehicle: 'Bus 101'
        },
        {
          id: '2',
          tripNumber: 'T-002',
          routeName: 'Route A - Downtown Loop',
          scheduledStartTime: '06:30',
          scheduledEndTime: '07:30',
          status: 'in-progress',
          assignedDriver: 'Jane Smith',
          assignedVehicle: 'Bus 102'
        },
        {
          id: '3',
          tripNumber: 'T-003',
          routeName: 'Route B - Airport Express',
          scheduledStartTime: '07:00',
          scheduledEndTime: '08:00',
          status: 'planned',
          assignedDriver: 'Mike Johnson',
          assignedVehicle: 'Bus 105'
        }
      ];

      setTrips(sampleTrips);
    } catch (error) {
      console.error('Error loading trips:', error);
    } finally {
      setLoading(false);
    }
  };

  const handleCreateDuty = () => {
    navigate('/duties/create');
  };

  const formatTime = (time: string) => {
    return time;
  };

  const getStatusLabel = (status: string) => {
    switch (status) {
      case 'in-progress':
        return 'In Progress';
      case 'completed':
        return 'Completed';
      default:
        return 'Planned';
    }
  };

  const renderTripsTab = () => (
    <>
      <DateSelector>
        <FiCalendar size={20} color={theme.colors.primary} />
        <DateInput
          type="date"
          value={selectedDate}
          onChange={(e) => setSelectedDate(e.target.value)}
        />
      </DateSelector>

      {loading ? (
        <div style={{ textAlign: 'center', padding: '40px' }}>
          <p style={{ color: theme.colors.textSecondary }}>Loading trips...</p>
        </div>
      ) : trips.length === 0 ? (
        <div style={{ textAlign: 'center', padding: '40px' }}>
          <p style={{ color: theme.colors.textSecondary }}>
            No trips found for {new Date(selectedDate).toLocaleDateString()}
          </p>
        </div>
      ) : (
        trips.map((trip) => (
          <TripCard key={trip.id}>
            <TripHeader>
              <TripInfo>
                <TripTitle>{trip.routeName}</TripTitle>
                <p style={{ 
                  color: theme.colors.textSecondary, 
                  fontSize: theme.typography.fontSize.sm,
                  margin: 0 
                }}>
                  Trip #{trip.tripNumber}
                </p>
              </TripInfo>
              <StatusBadge status={trip.status}>
                {getStatusLabel(trip.status)}
              </StatusBadge>
            </TripHeader>

            <TripDetails>
              <DetailItem label="Time">
                {formatTime(trip.scheduledStartTime)} - {formatTime(trip.scheduledEndTime)}
              </DetailItem>
              {trip.assignedDriver && (
                <DetailItem label="Driver">
                  <strong>Driver:</strong> {trip.assignedDriver}
                </DetailItem>
              )}
              {trip.assignedVehicle && (
                <DetailItem label="Vehicle">
                  <strong>Vehicle:</strong> {trip.assignedVehicle}
                </DetailItem>
              )}
            </TripDetails>
          </TripCard>
        ))
      )}
    </>
  );

  const renderAssignmentTab = () => (
    <div style={{ textAlign: 'center', padding: '40px' }}>
      <p style={{ color: theme.colors.textSecondary }}>
        Assignment management coming soon...
      </p>
    </div>
  );

  return (
    <PageContainer className="fade-in">
      <PageHeader>
        <PageTitle>Duties Management</PageTitle>
        <HeaderActions>
          <Button onClick={handleCreateDuty} variant="primary">
            <FiPlus style={{ marginRight: '8px' }} />
            Generate Trips
          </Button>
        </HeaderActions>
      </PageHeader>

      <TabsContainer>
        <Tab 
          active={activeTab === 'trips'} 
          onClick={() => setActiveTab('trips')}
        >
          Trips List
        </Tab>
        <Tab 
          active={activeTab === 'assignment'} 
          onClick={() => setActiveTab('assignment')}
        >
          Assignment
        </Tab>
      </TabsContainer>

      <ContentContainer>
        {activeTab === 'trips' ? renderTripsTab() : renderAssignmentTab()}
      </ContentContainer>
    </PageContainer>
  );
};

export default DutiesList;
